import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="app-header">
      <div className="container">
        <h1>포토씽킹 (PhotoThinking)</h1>
        <p className="logo-subtitle">내 사진으로 만드는 AI 창의력 쑥쑥 학습 웹</p>
      </div>
    </header>
  );
}

export default Header;
